import React from 'react';
import {Nav,Navbar,NavItem,NavbarBrand,Container} from 'reactstrap';
import '../css/dashboard.css';


export const Navs=()=>{
    return(
        <>
        <Navbar style={{marginTop:'3rem'}}>
                <NavbarBrand>
                    <div className="icon">
                        <div className="line1"></div>
                        <div className="line2"></div>
                    </div>  
                </NavbarBrand>
        </Navbar>      
        </>
    )
}
